  01> CAMPION, Andrew John
  b 01.10.1983
  Andrew b. at Wanganui. A keen skier and tramper, Andrew won the Manawatu Tramping and Skiing
  Club's Young Tramper of the Year award in 1993. In his final year at Monrad Intermediate, he
  was awarded Best All-round Contributor to School Life. He now attends Palmerston North Boys'
  High School and his interests include soccer, drama and art.
  02> MACKAY, Hamish Buchanan m on 26.03.1982 to (1)ELLIOTT, Helen Mary
  b 11.08.1955
  b 21.11.1960
