  02> MACKAY, Hamish Buchanan m on 19.03.1993 to (3)CHANDULAL, Anna
  Jacqueline
  b 11.08.1955
  b 21.04.1965
  Hamish m, at Auckland, Anna, d/o Dr Maurice Kiran Chandulal and Lesley Eccles. Address: 12 Helmore
  Street, Wanganui.
  Hamish was educated at Hereworth School, Wanganui Collegiate School and Victoria University. He
  was a colts hockey rep for Wanganui/Manawatu, Hutt Valley and Wellington, and a senior rep for Hutt
  Valley.
  Hamish was a stockbroker in Auckland from 1977 to 1990 and was elected a member of the New Zealand
  Stock Exchange in 1983. From 1991-93 he was a director and major shareholder of Independent
  Telephone Network Ltd, a boutique provider of a discounted toll calling service between Auckland
  and Wellington in competition with Telecom and Clear. Upon selling the business in 1993, he
  established the Wanganui office of the national stockbroking firm, Craig and Co Ltd, of which he is
  a director.
  Hamish is a member of the Wanganui Rotary Club, a Trustee of the Wanganui Collegiate School
  Foundation and a member of the Wanganui Chamber of Commerce.
